import React from 'react'
import { Card, CardContent, Typography } from '@material-ui/core';
import Chip from '@material-ui/core/Chip'

export default function HobbiesCard() {

    const hobbies = ['exercise', 'nutrition', 'reading', 'writing', 'yoga','guitar', 'mediation',
                    'programming', 'piano', 'deep reflections', 'learning']


    return (
        <Card>
            <CardContent>
                <Typography color="textSecondary" variant="h4">
                    Hobbies and Interests
                </Typography>
                <Typography variant="body1" component="p">
                    <Chip label="exercise" color="primary" />
                    <Chip label="nutrition" color="primary" />
                </Typography>
            </CardContent>
        </Card>
    )
}
